import React from "react";
import { Navbar, Button, Link } from "@nextui-org/react";
import { Layout } from "./Navbar/Layout.js";
import { AcmeLogo } from "./Navbar/AcmeLogo.js";
import { useTheme, Text } from '@nextui-org/react';


export default function App() {

  const [variant] = React.useState("sticky");

  return (
    <Layout>
      <Navbar variant={variant} style = {{fontFamily: "Inter"}}>
        <Navbar.Brand>
          <Text b color="inherit" hideIn="xs">
            osiris.cc
          </Text>
        </Navbar.Brand>
        <Navbar.Content hideIn="xs">
          <Navbar.Link href="#">Home</Navbar.Link>
          <Navbar.Link isActive href="#">Features</Navbar.Link>
          <Navbar.Link href="#">Purchase</Navbar.Link>
        </Navbar.Content>
        <Navbar.Content>
          <Navbar.Item>
          <Button color="primary" auto>
          Primary
        </Button>
        </Navbar.Item>
        </Navbar.Content>
      </Navbar>

    <>
      <Text size="$6xl"  style = {{marginLeft: "160px", marginTop: "240px", fontFamily: "Inter", fontWeight: "bold",  }} >The Greatest Streamable</Text>
      <Text size="$xl" style = {{marginLeft: "160px", marginTop: "35px", fontFamily: "Inter", fontWeight: "semibold"}} >Prioritizing your security and legitness, we're indisputably the greatest streamable.</Text>
    </>
      <Button color="primary" mini style = {{marginLeft: "160px", marginTop: "40px"}} >Purchase</Button>
    </Layout>
  );
}
